import axios from "axios";

export const CATEGORIES_BASE_GET_URL = "http://localhost:8080/api/v1/categories";
export const CATEGORIES_BASE_POST_URL = "http://localhost:8080/api/v1/categories";
export const IMAGES_BASE_POST_URL = "http://localhost:8080/api/v1//images";
export const IMAGES_BASE_GET_URL = "http://localhost:8080/api/v1/images";

class Services {
  saveCategories(category) {
    return axios.post(CATEGORIES_BASE_GET_URL, category);
  }
  getItems() {
    return axios.get(IMAGES_BASE_GET_URL);
  }
  uploadImages(image) {
    return axios.post(IMAGES_BASE_POST_URL,image);
  }
}
export default new Services();
